import React from "react"
import ReactDOM from "react-dom"

const TodoList = () => {

    const items = ['Learn React', 'Drink coffee']
    return(
        <ul>
            <li>{items[0]}</li>
            <li>{items[1]}</li>
        </ul>
    )
}

const AppHeader = () => {
    return (
        <h1>My todo list</h1>
    )
}

const SearchPanel = () => {

    const searchText = 'Type here to search'
    return (
        <input placeholder={searchText} />
    )
}

const App = () => {

    return (
        <div>
            <AppHeader />
            <SearchPanel />
            <TodoList />
        </div>
    )
}

ReactDOM.render(<App />,
    document.getElementById('root'))
